import React, { useState } from 'react';

const TodoList = () => {
    const [items, setItems] = useState([{ text: 'Item 1', completed: false }]);
    const [members, setMembers] = useState(['Member 1']);
    const [newItem, setNewItem] = useState('');
    const [newMember, setNewMember] = useState('');

    // Adds a new item to the list
    const handleAddItem = () => {
        if (newItem.trim()) {
            setItems([...items, { text: newItem, completed: false }]);
            setNewItem('');
        }
    };

    // Adds a new member to the members list
    const handleAddMember = () => {
        if (newMember.trim()) {
            setMembers([...members, newMember]);
            setNewMember('');
        }
    };

    // Toggles the completed state of an item
    const handleToggleComplete = (index) => {
        const updatedItems = [...items];
        updatedItems[index].completed = !updatedItems[index].completed;
        setItems(updatedItems);
    };

    // Deletes an item from the list
    const handleDeleteItem = (index) => {
        setItems(items.filter((_, i) => i !== index));
    };

    // Deletes a member from the members list
    const handleDeleteMember = (index) => {
        setMembers(members.filter((_, i) => i !== index));
    };

    return (
        <div style={{ backgroundColor: '#333', color: 'white', padding: '20px', borderRadius: '8px', width: '100%', maxWidth: '600px' }}>
            <h2>Todo List</h2>
            <div style={{ display: 'flex', marginBottom: '10px' }}>
                <input
                    type="text"
                    value={newItem}
                    onChange={(e) => setNewItem(e.target.value)}
                    placeholder="Add new item"
                    style={{ flexGrow: 1, marginRight: '10px', padding: '8px', borderRadius: '4px', border: '1px solid #ccc' }}
                />
                <button onClick={handleAddItem} style={{ padding: '8px 12px', backgroundColor: '#28a745', color: 'white', borderRadius: '4px', border: 'none', cursor: 'pointer' }}>Add</button>
            </div>
            <ul style={{ listStyle: 'none', padding: 0 }}>
                {items.map((item, index) => (
                    <li key={index} style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', margin: '8px 0', padding: '8px', backgroundColor: '#444', borderRadius: '4px' }}>
                        <span
                            style={{
                                textDecoration: item.completed ? 'line-through' : 'none',
                                color: item.completed ? '#aaa' : 'inherit'
                            }}
                        >
                            {item.text}
                        </span>
                        <div>
                            <button onClick={() => handleToggleComplete(index)} style={{ background: 'none', border: 'none', color: '#28a745', cursor: 'pointer', marginRight: '8px' }}>✓</button>
                            <button onClick={() => handleDeleteItem(index)} style={{ background: 'none', border: 'none', color: '#f00', cursor: 'pointer' }}>✗</button>
                        </div>
                    </li>
                ))}
            </ul>

            <h2>Members</h2>
            <div style={{ display: 'flex', marginBottom: '10px' }}>
                <input
                    type="text"
                    value={newMember}
                    onChange={(e) => setNewMember(e.target.value)}
                    placeholder="Add new member"
                    style={{ flexGrow: 1, marginRight: '10px', padding: '8px', borderRadius: '4px', border: '1px solid #ccc' }}
                />
                <button onClick={handleAddMember} style={{ padding: '8px 12px', backgroundColor: '#007bff', color: 'white', borderRadius: '4px', border: 'none', cursor: 'pointer' }}>Add</button>
            </div>
            <ul style={{ listStyle: 'none', padding: 0 }}>
                {members.map((member, index) => (
                    <li key={index} style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', margin: '8px 0', padding: '8px', backgroundColor: '#444', borderRadius: '4px' }}>
                        <span>{member}</span>
                        <button onClick={() => handleDeleteMember(index)} style={{ background: 'none', border: 'none', color: '#f00', cursor: 'pointer' }}>✗</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default TodoList;
